class Solution:
    def repeatedStringMatch(self, A, B):
        """
        :type A: str
        :type B: str
        :rtype: int
        """
        n = -(-len(B) // len(A))
        if B in A * n: return n
        if B in A * (n + 1): return n + 1

        return -1

A = ""
B = ""

sol = Solution()
print(sol.repeatedStringMatch(A, B))